const App = () => {
  const categories = [
    { id: 1, name: "Hatts" },
    { id: 2, name: "Jacket" },
    { id: 3, name: "Sneakers" },
    { id: 4, name: "Womens" },
    { id: 5, name: "Mens" },
  ];
  return (
    <div className="categories-container">
      {categories.map(({ title }) => {
        <div className="category-container">
          {/* <img /> */}
          <div className="category-body-container">
            <h1>{title}</h1>
            <p>Shop now</p>
          </div>
        </div>;
      })}
    </div>
  );
};

export default App;
